/**
 *******************************************************************************
 *
 * \brief   Read Lens parameters from file
 *
 *          It is called in Create function.
 *          In this function SwMs alg link params are set
 *          The algorithm which is to run on core is set to
 *          baseClassCreate.algId. The input whdth and height to alg are set.
 *          Number of input buffers required by alg are also set here.
 *
 *******************************************************************************
*/
ldc_lensParameters* Chains_lens_getLensPrm()
{
    Int32 fp;
    UInt32 readSize;
    ldc_lensParameters *pVirtLensPrm;

    if(FALSE == gLensPrmRead)
    {
        if(NULL == gLensPrm)
        {
            gLensPrm = ChainsCommon_Osal_memAlloc(
                                sizeof(ldc_lensParameters),
                                128);
            UTILS_assert(NULL != gLensPrm);

            Vps_printf(" gLensPrm = 0x%X\n", gLensPrm);
        }

        pVirtLensPrm = \
        (ldc_lensParameters*)ChainsCommon_Osal_getVirtAddr((UInt32)gLensPrm);

        fp = ChainsCommon_Osal_fileOpen(
                        CHAINS_LENS_FILENAME,
                        CHAINSCOMMON_OSAL_FILEMODE_READ_BIN);
        if(-1 != fp)
        {
            ChainsCommon_Osal_fileRead(
                        fp,
                        (UInt8*)pVirtLensPrm,
                        sizeof(ldc_lensParameters),
                        &readSize);
            UTILS_assert(readSize == sizeof(ldc_lensParameters));

            ChainsCommon_Osal_fileClose(fp);

            Vps_printf(" Lens parameters read\n");

            gLensPrmRead = TRUE;
        }
        else
        {
            /*  The lens parameter file is not present, use the default
                parameters */
            Vps_printf(" Lens file is NOT present, using the default lens parameters\n");

            pVirtLensPrm->ldcLUT_numCams = def_ldcLUT_numCams;
            memcpy(
                pVirtLensPrm->ldcLUT_distortionCenters,
                def_ldcLUT_distortionCenters,
                sizeof(Int32) * 2 * LDC_MAX_NUM_CAMERAS);
            pVirtLensPrm->ldcLUT_focalLength = def_ldcLUT_focalLength;

            pVirtLensPrm->U2D_type = def_U2D_type;
            pVirtLensPrm->ldcLUT_U2D_length = def_ldcLUT_U2D_length;
            pVirtLensPrm->ldcLUT_U2D_step = def_ldcLUT_U2D_step;
            memcpy(
                pVirtLensPrm->ldcLUT_U2D_table,
                def_ldcLUT_U2D_table,
                sizeof(float) * def_ldcLUT_U2D_length);

            pVirtLensPrm->D2U_type = def_D2U_type;
            pVirtLensPrm->ldcLUT_D2U_length = def_ldcLUT_D2U_length;
            pVirtLensPrm->ldcLUT_D2U_step = def_ldcLUT_D2U_step;
            memcpy(
                pVirtLensPrm->ldcLUT_D2U_table,
                def_ldcLUT_D2U_table,
                sizeof(float) * def_ldcLUT_D2U_length);
        }

        ChainsCommon_Osal_cacheWb(
                (UInt32)pVirtLensPrm,
                sizeof(ldc_lensParameters));
    }

    return (gLensPrm);
}

